static const int BLOCK = 1;
static const int HOLLOW = 0;
static const int VISITED_HOLLOW = 2;

class Solution {
public:
    inline int trapRainWater(vector<vector<int> >& heightMap) {
        if (heightMap.empty() || heightMap[0].empty()) {
            return 0;
        }

        int max_height = 0;
        for (const auto& row : heightMap) {
            max_height = std::max(max_height, *std::max_element(row.begin(), row.end()));
        }
        
        int ret = 0;
        std::vector<std::vector<int> > slice_map(heightMap.size(), std::vector<int>(heightMap[0].size(), HOLLOW));
        for (int height = max_height; height > 0; --height) {
            sliceByHeight(height, heightMap, slice_map);
            ret += getSliceTrapCount(slice_map);
        }
        return ret;
    }

    inline void sliceByHeight(int height, const std::vector<std::vector<int> >& height_map, std::vector<std::vector<int> >& ret) {
        for (size_t i=0; i<height_map.size(); ++i) {
            for (size_t j=0; j<height_map[i].size(); ++j) {
                if (height_map[i][j] >= height) {
                    ret[i][j] = BLOCK;
                } else {
                    ret[i][j] = HOLLOW;
                }
            }
        }
    }
    
    bool sliceDFS(int row, int col, int& hollow_count, std::vector<std::vector<int> >& slice_map) {
        assert(slice_map[row][col] == HOLLOW);

        bool valid = (row != 0 && row != int(slice_map.size()-1) && col != 0 && col != int(slice_map[0].size()-1));
        slice_map[row][col] = VISITED_HOLLOW;
        hollow_count++;

        if (row != 0 && slice_map[row-1][col] == HOLLOW) {
            bool tmp = sliceDFS(row-1, col, hollow_count, slice_map);
            valid = valid && tmp;
        }
        if (row != int(slice_map.size()-1) && slice_map[row+1][col] == HOLLOW) {
            bool tmp = sliceDFS(row+1, col, hollow_count, slice_map);
            valid = valid && tmp;
        }
        if (col != 0 && slice_map[row][col-1] == HOLLOW) {
            bool tmp = sliceDFS(row, col-1, hollow_count, slice_map);
            valid = valid && tmp;
        }
        if (col != int(slice_map[0].size()-1) && slice_map[row][col+1] == HOLLOW) {
            bool tmp = sliceDFS(row, col+1, hollow_count, slice_map);
            valid = valid && tmp;
        }
        return valid;
    }

    inline int getSliceTrapCount(std::vector<std::vector<int> >& slice_map) {
        int trap_count = 0;
        int hollow_count = 0;
        for (int row=0; row<int(slice_map.size()); ++row) {
            for (int col=0; col<int(slice_map[0].size()); ++col) {
                if (slice_map[row][col] != HOLLOW) {
                    continue;
                }

                hollow_count = 0;
                bool trap = sliceDFS(row, col, hollow_count, slice_map);
                if (trap) {
                    trap_count += hollow_count;
                }
            }
        }
        return trap_count;
    }
};

